HTMLTemplate\",\n    \"required\": false,\n    \"label\": \"Custom HTML\",\n    \"name\": \"customHTMLTemplate-1594549927863\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"jumbotron\\\">\\t<p>\\t\\t<b>31.</b>\\t\\tThree horsemen A, B and C perform at each of the three (morning, afternoon, and evening) shows of the circus. Each horseman rides only one of the horses at each show. The horses are called N, O or P for simplicity here. The following is known about the horses they rode:\\t</p>\\t<p>B does not ride O in any show</p>\\t<hr>\\t<p>C rides P in one show, but not the afternoon show</p>\\t<hr>\\t<p>A rides the same horse in the afternoon and evening</p>\\t<hr>\\t<p>C does not ride O in the morning show</p></div>\"\n  },\n  {\n    \"type\": \"customMC1Question\",\n    \"required\": false,\n    \"label\": \"Custom mc1 Answer\",\n    \"name\": \"customMC1Question-31\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"container\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>31A. </b>\\t\\tWhich of the following MUST be true\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q31a\\\">\\t\\t\\t<input class=\\\"custom_mc_radio\\\" type=\\\"radio\\\" name=\\\"q31a\\\" value=\\\"1\\\">\\t\\t\\tA rides O in the morning\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q31a\\\">\\t\\t\\t<input class=\\\"custom_mc_radio\\\" type=\\\"radio\\\" name=\\\"q31a\\\" value=\\\"2\\\">\\t\\t\\tB rides N in the morning\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q31a\\\">\\t\\t\\t<input class=\\\"custom_mc_radio\\\" type=\\\"radio\\\" name=\\\"q31a\\\" value=\\\"3\\\">\\t\\t\\tC rides O in the afternoon\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q31a\\\">\\t\\t\\t<input class=\\\"custom_mc_radio\\\" type=\\\"radio\\\" name=\\\"q31a\\\"