ge Marker</b></span>\",\n    \"name\": \"startPageMarker-56\",\n    \"access\": false,\n    \"randomize\": \"false\",\n    \"onTimerTimesUp\": \"console.log(\\\"Times up!\\\");\",\n    \"enableSnapshot\": \"false\"\n  },\n  {\n    \"type\": \"customHTMLTemplate\",\n    \"required\": false,\n    \"label\": \"Custom HTML\",\n    \"name\": \"customHTMLTemplate-1594132966333\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"jumbotron\\\">\\t<h5>Part 3: Reading Comprehension</h5>\\t<hr>\\t<p>This is the last part of the assessment, with 10 items, which measures reading comprehension.</p>\\t<p>\\t\\tInstruction: Questions here ask you to read a passage, an article or an excerpt. Each of them is followed by multiple choice questions about the reading material.\\t\\t<br>\\t\\t<br>\\t\\tExample:\\t\\t<br>\\t\\t<br>\\t\\tSuccessful job-hunting requires careful preparation. First, you need to list the kinds of jobs you would like. Then you need to determine the qualifications you have and the skills and experiences for the job.\\t\\t<br>\\t\\t<br>\\t\\tWhich of the following statements is NOT supported by the above statement?\\t\\t<br>\\t\\t<br>\\t\\tA. Successful job-hunting requires a list of the kinds of jobs you would like.\\tB. Successful job-hunting requires a list of the qualifications you have.\\tC. Successful job-hunting requires preparation of social events.\\tD. Successful job-hunting requires the need to determine the skills and experience for the job.\\tAnswer:\\t\\t<br>\\t\\t<br>\\t\\t“C” is not supported by the above passage. In other words, nothing on the passage allows you to conclude that successful job hunting requires preparation of social events. A, B and D ARE supported by the passage. That is, the passage allows you to come to the conclusion that successful job-hunting requires careful preparation.\\t\\t<br>\\t\\t<br>\\t\\tSome questions have 2 correct answers. Provide your answer/s in the box. You will gain a point for every correct answer but