": false,\n    \"value\": \"<div class=\\\"container\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>51. </b>\\t\\tAll good athletes are in fine physical condition.\\t\\t<b>Some, not all,</b>\\t\\tgood athletes have poor scholastic records. Which of the following statement is supported by the above passage?\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"1\\\">\\t\\t\\tSome persons with poor scholastic records are in fine physical condition.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"2\\\">\\t\\t\\tIf a person is in fine physical condition, he will have a poor scholastic record.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"3\\\">\\t\\t\\tSome persons in fine physical condition have poor scholastic records.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"4\\\">\\t\\t\\tEvery student who has a good scholastic record and is a good athlete is in fine physical condition.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"5\\\">\\t\\t\\tNone of the above\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q51\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q51[]\\\" value=\\\"6\\\">\\t\\t\\tI do not know the answer\\t\\t</label>\\t</div></div>\"\n  },\n  {\n    \"type\": \"customMC2Question\",\n    \"required\": false,\n    \"label\": \"Custom mc2 Answer\",\n    \"name\": \"customMC2Question-57\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"container\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>52. </b>\\t\\tOf all the memory techniques, repetition is the most effective of all. This idea might sound too simple. Still, it is the most helpful way to put facts into your memory. The key is repeating the information enough times so it becomes a part of your long-term memory. Which of the following statement is NOT supported by the above passage?\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"1\\\">\\t\\t\\tRepetition is the most effective memory technique.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"2\\\">\\t\\t\\tRepetition as an idea sounds complicated.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"3\\\">\\t\\t\\tRepetition is the most helpful way to put facts into memory.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"4\\\">\\t\\t\\tRepetition of information can become a part of long term memory.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"5\\\">\\t\\t\\tNone of the above\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q52\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q52[]\\\" value=\\\"6\\\">\\t\\t\\tI do not know the answer\\t\\t</label>\\t</div></div>\"\n  },\n  {\n    \"type\": \"customMC2Question\",\n    \"required\": false,\n    \"label\": \"Custom mc2 Answer\",\n    \"name\": \"customMC2Question-58\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"container\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>53. </b>\\t\\tWhen a drug is first placed in the market, usually it is patented for 17 years. That means no one can manufacture another drug with the same chemical formulation during those years. Only when the patent has expired can other pharmaceutical companies manufacture generic versions of brand-name drugs. For that reason, some drugs currently on the market do not have generic versions. What is the relationship between these sentences - \\\"Only when the patent has expired can other pharmaceutical companies manufacture generic versions of brand-name drugs.\\\" \\\"For that reason, some drugs currently in the market do not have generic versions.\\\"?\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"1\\\">\\t\\t\\tCause & Effect\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"2\\\">\\t\\t\\tStatement and Clarification\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"3\\\">\\t\\t\\tExample\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"4\\\">\\t\\t\\tSummary\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"5\\\">\\t\\t\\tNone of the above\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q53\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q53[]\\\" value=\\\"6\\\">\\t\\t\\tI do not know the answer\\t\\t</label>\\t</div></div>\"\n  },\n  {\n    \"type\": \"customMC2Question\",\n    \"required\": false,\n    \"label\": \"Custom mc2 Answer\",\n    \"name\": \"customMC2Question-59\",\n    \"access\": false,\n    \"value\": \"<div class=\\\"container\\\">\\t<div class=\\\"row custom_mc_row_question\\\">\\t\\t<b>54. </b>\\t\\tIf a belief is not grounded on conviction, it is likely to give way before the slightest of arguments. Many of our beliefs are not based on conviction, but are carelessly adopted. Is giving way an option despite conviction?\\t\\t<bv></bv>\\t\\tWhich of the following statement is\\t\\t<b>NOT</b>\\t\\tsupported by the above passage?\\t\\t<br>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q54\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q54[]\\\" value=\\\"1\\\">\\t\\t\\tThere is likelihood that we can be easily argued out of many of our beliefs.\\t\\t</label>\\t</div>\\t<div class=\\\"row custom_mc_row\\\">\\t\\t<label class=\\\"custom_mc_container q54\\\">\\t\\t\\t<input class=\\\"custom_mc_checkbox\\\" type=\\\"checkbox\\\" name=\\\"q54[]\\\" value=\\\"2\\\">\\t\\t\\tMany people have convictions that are carele