/*!50003 CREATE DEFINER=`dataadmin`@`localhost` PROCEDURE `finaldata`(
IN uname VARCHAR(255),
IN uexam VARCHAR(255),
IN lstno VARCHAR(255),
IN cpart INT(10),
IN cpage INT(10),
IN ttext TEXT,
IN dimen TEXT,
IN dscore TEXT
)
BEGIN
	
DECLARE tmp_username text;
DECLARE tmp_dimen text;
DECLARE tmp_dimen1 text;
DECLARE cnt_username int DEFAULT 0;
DECLARE nxt_page int DEFAULT 0;
DECLARE dim_length INT DEFAULT 0;
DECLARE cnt INT DEFAULT 0;
DECLARE tmplen INT DEFAULT 0;
DECLARE tmpslen INT DEFAULT 0;
DECLARE tmpscore text;
DECLARE tmpscore1 INT DEFAULT 0;
DECLARE tmpsdcnt INT DEFAULT 0;
DECLARE tmpsd TEXT;
DECLARE tmpcompany varchar(1000);
DECLARE tmpmeters int DEFAULT 0;
DECLARE tmpdate TEXT;
DECLARE tmp_meters TEXT;
set nxt_page = cpage + 1;
Select `answer` into tmp_username from tbanswer_temp where `UserID` = uname and `TestID` = uexam;
delete from tbanswer_temp where `UserID` = uname and `TestID` = uexam;
set ttext = concat(tmp_username,ttext);
insert into tbanswer(`userID`,`TestID`,`answer`,`page`) values (uname,uexam,ttext,cpage);
SET dim_length = CHAR_LENGTH(dimen);
SET cnt = 0;
SET tmp_dimen = dimen;
SET tmpscore = dscore;
SET tmpslen = 0;
while CHAR_LENGTH(tmp_dimen) > 0 do
Set tmplen = INSTR(tmp_dimen, ',') - 1 ;
Set tmpslen = INSTR(tmpscore, ',') - 1 ;
if tmplen > 0 then
set tmp_dimen1 =substr(tmp_dimen,1,tmplen);
set tmp_dimen =substr(tmp_dimen,(tmplen + 2));
set tmpscore1 = substr(tmpscore,1,tmpslen) * 1;
set tmpscore =substr(tmpscore,(tmpslen + 2));
else
set tmp_dimen1 =tmp_dimen;
set tmp_dimen ='';
set tmpscore1 =tmpscore * 1;
set tmpscore ='';
end if;
if tmp_dimen1 != '' then 
Select Score into tmpsd from tbresult where UserID=uname and TestID=uexam and DimID=tmp_dimen1;
select count(tmpsd) into tmpsdcnt;
if tmpsdcnt = 0 then 
 insert into tbresult(UserID,TestID,DimID,Score) values (uname,uexam,tmp_dimen1,tmpscore1);
else
set tmpscore1 = tmpscore1 + tmpsd;
 update tbresult SET Score = tmpscore1 where UserID = uname and TestID = uexam and DimID = tmp_dimen1;
end if;
end if;
end while;
select `company` into tmpcompany from tbtaker where username = uname;
select `meters` into tmpmeters from tbusers where `identity` = tmpcompany;
set tmpdate = concat(year(curdate()),month(curdate()));
if tmpmeters != 0 then
set tmpmeters= tmpmeters-1;
update tbusers SET `meters` = tmpmeters where identity = tmpcompany;
update tbstatus SET `page`=cpage, status='scored', date_completed = curdate(), `usage` = tmpdate where user_id = uname and AssCode = uexam;
select 'scored';
else
update tbstatus SET page=cpage, status='completed', date_completed = curdate(), `usage` = tmpdate where user_id = uname and AssCode = uexam;
select 'completed';
end if;
    END */$$
DELIMITER ;

